import Tile from "./Tile";



// should take in props so it can be customized for different uses
export default function TileGrid() {
  // do stuff to set up <Tile> compon.s grid of tiles :P
  let listOfAnimeTitles = ["Sup", "Hello", "How goes it"];

  return (
    // return resulting grid of <Tile> compon.s
    listOfAnimeTitles.forEach((currTitle) => {
      <Tile name={currTitle} />
    })
  )
}


let listA = [1, 2, 3];
// to make a list that's like listA, but with a 4 at the end...
let listB = [...listA, 4];

// myArray.map() is basically a range-based for loop...
listA.map((elemOfListA) => {
  // operation performed on each elemOfListA; for ex., to mutate each elemOfListA...
  return elemOfListA * 10;

  // in React, you can also use...
